// sections for this page

import Projects3 from "./sections-sections/Projects3.js";

function ProfilePage() {

  return (
    <>
      <WhiteNavbar />
      <div className="wrapper">
        <div className="section-space"></div>

        <Projects3 />


        <Footer />
      </div>
    </>
  );
}


export default ProfilePage;
